import React from "react";
import { Box, InputBase, styled } from "@mui/material";
import { Search as SearchIcon } from "@mui/icons-material";

const Component = styled(Box)`
  background: #fff;
  height: 45px;
`;

const Search = () => {
  return (
    <Box>
      <Box>
        <SearchIcon />
      </Box>
      <InputBase />
    </Box>
  );
};

export default Search;
